import React from "react";

export class CoreTable extends React.Component {
    render() {
        return (
            <div>
                <h3>Core Modules</h3>
                <table className="table table-dark table-hover">
                    <tbody>{this.props.module}</tbody>
                </table>
            </div>
        )
    }
}

export class SpecTable extends React.Component {
    render(){
        return (
            <div>
                <h3>Specialisation Modules</h3>
                <table className="table table-hover">
                    <tbody>{this.props.specialisation}</tbody>
                </table>
            </div>
        )
    }
}
export class UnrestrictedTable extends React.Component {
    render(){
        return(
        <div>
            <h3>Unrestricted Electives</h3>
              <table className="table table-hover">
                  <tbody>{this.props.module}</tbody>
                </table>
        </div>
        )
    } 
}

export class SummaryTable extends React.Component    {
    render() { 
        return (
        <div>
            <h3>Total Modular Credits</h3>
        </div>
        )
    }
}
